/*	Customers
 ================================================ */
CREATE TABLE customers (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    email varchar(60) NOT NULL UNIQUE,
    familyname varchar(40) NOT NULL,
    givenname varchar(40) NOT NULL,
    gender char(1),
    street varchar(64),
    town varchar(48),
    state varchar(3),
    postcode char(4) CONSTRAINT ck_customers_postcode CHECK (postcode SIMILAR TO '[0-9][0-9][0-9][0-9]'),
    dob date CHECK (dob < CURRENT_DATE - interval '18 years'),
    phone char(10) CONSTRAINT ck_customers_phone CHECK (phone SIMILAR TO '[01][0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9]'),
    spam boolean DEFAULT FALSE,
    height decimal(4, 1),
    registered date NOT NULL
);

CREATE INDEX ix_customers_familyname ON customers (lower(familyname));


/*	Authors
 ================================================ */
CREATE TABLE authors (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    givenname varchar(40),
    othernames varchar(40),
    familyname varchar(40),
    born date,
    died date,
    gender char(1),
    home varchar(128),
    country varchar(24)
);


/*	Books
 ================================================ */
CREATE TABLE books (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    authorid int REFERENCES authors (id),
    title varchar(255),
    published int,
    price numeric(4, 2)
);


/*	Genres
 ================================================ */
CREATE TABLE booksgenres (
    id int PRIMARY KEY,
    genres varchar(255)
);

CREATE TABLE genres (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    genre varchar(60)
);

CREATE TABLE bookgenres (
    bookid int REFERENCES books (id),
    genreid int REFERENCES genres (id),
    PRIMARY KEY (bookid, genreid)
);


/*	Sales & Sale Items
 ================================================ */
CREATE TABLE sales (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    customerid int REFERENCES customers (id) NOT NULL,
    total numeric(6, 2),
    ordered timestamp,
    shipped date
);

CREATE TABLE saleitems (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id int SERIAL PRIMARY KEY,
    saleid int REFERENCES sales (id) ON DELETE CASCADE NOT NULL,
    bookid int REFERENCES books (id) NOT NULL,
    quantity int,
    price numeric(6, 2)
);

CREATE TABLE deleted_sales (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    saleid int,
    customerid int,
    items varchar(255),
    deleted_date timestamp
);


/*	Catalogue View
 ================================================ */
CREATE VIEW catalogue AS
SELECT
    b.id,
    b.title,
    b.published,
    a.givenname || ' ' || a.familyname AS author,
    a.home,
    to_char(b.price, 'fm9990.00') AS price,
    to_char(b.price * 0.1, 'fm9990.00') AS tax,
    to_char(b.price * 1.1, 'fm9990.00') AS total
FROM
    books AS b
    LEFT JOIN authors AS a ON b.authorid = a.id
WHERE
    b.price IS NOT NULL;


/*	Employees
 ================================================ */
CREATE TABLE employees (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id INT SERIAL PRIMARY KEY,
    supervisorid int REFERENCES employees (id),
    givenname varchar(24) NOT NULL,
    familyname varchar(24) NOT NULL,
    email varchar(60),
    phone char(10) CONSTRAINT ck_employees_phone CHECK (phone ~ '0\d{9}'),
    tfn char(9) CONSTRAINT ck_employees_tfn CHECK (tfn ~ '\d{9}')
    --	etc
);


/*	Sorting
 ================================================ */
CREATE TABLE sorting (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    --	id INT SERIAL PRIMARY KEY,
    numbervalue int,
    datevalue date,
    stringvalue varchar,
    datestring varchar,
    numberstring varchar,
    numbername varchar,
    fullname varchar,
    email varchar,
    firstname varchar,
    lastname varchar
);


/*	Bad Table
