CREATE TABLE badtable (
    "customer code" int PRIMARY KEY,
    customer varchar(63),
    "order" varchar(12),
    "1st" date,
    "42" varchar(255),
    "last-date" date
);


/*	VIP
 ================================================
 This table is in a one-to-maybe relationship with customers.
 ================================================ */
CREATE TABLE vip (
    id int PRIMARY KEY REFERENCES customers (id),
    status int, --	1=gold,2=silver=3=bronze
    discount DECIMAL(3, 2),
    review date
);


/*	Mini Books & Authors
 ================================================
 Miniature versions to illustrate joins.
 ================================================ */
CREATE TABLE miniauthors (
    id int PRIMARY KEY,
    fullname varchar(255)
);

CREATE TABLE minibooks (
    id int PRIMARY KEY,
    title varchar(255),
    authorid int REFERENCES miniauthors (id)
);


/*	Multi Books & Authors
 ================================================
 Miniature versions to illustrate Multiple Authors.
 ================================================ */
CREATE TABLE multibooks (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    title varchar(60)
    --	etc
);

CREATE TABLE multiauthors (
    id int GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY,
    givenname varchar(24),
    familyname varchar(24)
    --	etc
);

CREATE TABLE authorship (
    bookid int REFERENCES multibooks (id),
    authorid int REFERENCES multiauthors (id),
    PRIMARY KEY (authorid, bookid)
);

