/*	Books Postscript
 ================================================
 Populate Genre Tables
 ================================================ */
--	Populate Genres
TRUNCATE TABLE genres CASCADE;

WITH RECURSIVE split (
    bookid,
    genre,
    rest,
    genres
) AS (
    SELECT
        b.id,
        '',
        bg.genres || ',',
        bg.genres
    FROM
        books AS b
        JOIN booksgenres AS bg ON b.id = bg.id
UNION ALL
SELECT
    bookid,
    substring(rest, 0, position(',' IN rest)),
    substring(rest, position(',' IN rest) + 1),
    genres
FROM
    split
    WHERE
        rest <> '')
INSERT INTO genres (genre)
SELECT DISTINCT
    genre
FROM
    split
WHERE
    split.genre <> '';

--	Populate Book Genres
WITH RECURSIVE split (
    bookid,
    genre,
    rest,
    genres
) AS (
    SELECT
        b.id,
        '',
        bg.genres || ',',
        bg.genres
    FROM
        books AS b
        JOIN booksgenres AS bg ON b.id = bg.id
UNION ALL
SELECT
    bookid,
    substring(rest, 0, position(',' IN rest)),
    substring(rest, position(',' IN rest) + 1, 255),
    genres
FROM
    split
    WHERE
        rest <> '')
INSERT INTO bookgenres (bookid, genreid)
SELECT
    split.bookid,
    genres.id
FROM
    split
    JOIN genres ON split.genre = genres.genre
WHERE
    split.genre <> '';

--	DROP genres table
DROP TABLE booksgenres;


