/*	Books Postscript
 ================================================
 Update Sales
 ================================================ */
WITH d AS (
    SELECT
        CURRENT_TIMESTAMP - max(ordered) AS diff
    FROM
        sales
    WHERE
        ordered IS NOT NULL)
UPDATE
    sales
SET
    ordered = ordered + d.diff,
    shipped = shipped + d.diff
FROM
    d;

